INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (1, 'This Pokémon''s damaging moves have a 10% chance to make the target flinch with each hit if they do not already cause flinching as a secondary effect.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (2, 'The weather changes to rain when this Pokémon enters battle and does not end unless replaced by another weather condition.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (3, 'This Pokémon''s Speed rises one stage after each turn.', 'Raises Speed one stage after each turn.', 1);
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (4, 'Moves cannot score critical hits against this Pokémon.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (5, 'When this Pokémon is at full HP, any hit that would knock it out will instead leave it with 1 HP.  Regardless of its current HP, it is also immune to the one-hit KO moves: fissure, guillotine, horn drill, and sheer cold.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (6, 'While this Pokémon is in battle, self destruct and explosion will fail and aftermath will not take effect.', 'Prevents self destruct, explosion, and aftermath from working while the Pokémon is in battle.', 1);
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (7, 'This Pokémon cannot be paralyzed.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (8, 'During a sandstorm, this Pokémon has 1.25× its evasion, and it does not take sandstorm damage regardless of type.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (9, 'Whenever a move makes contact with this Pokémon, the move''s user has a 30% chance of being paralyzed.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (10, 'Whenever an electric-type move hits this Pokémon, it heals for 1/4 of its maximum HP, negating any other effect on it.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (11, 'Whenever a water-type move hits this Pokémon, it heals for 1/4 of its maximum HP, negating any other effect on it.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (12, 'This Pokémon cannot be infatuated and is immune to captivate.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (13, 'While this Pokémon is in battle, weather can still be in play, but will not have any of its effects.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (14, 'This Pokémon''s moves have 1.3× their accuracy.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (15, 'This Pokémon cannot be asleep.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (16, 'Whenever this Pokémon takes damage from a move, the Pokémon''s type changes to match the move.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (17, 'This Pokémon cannot be poisoned.  This includes bad poison.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (18, 'This Pokémon is immune to fire-type moves.  Once this Pokémon has been hit by a Fire move, its own Fire moves will inflict 1.5× as much damage until it leaves battle.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (19, 'This Pokémon is immune to the extra effects of moves used against it.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (20, 'This Pokémon cannot be confused.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (21, 'This Pokémon cannot be forced out of battle by moves such as whirlwind.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (22, 'When this Pokémon enters battle, the opponent''s Attack is lowered by one stage.  In a double battle, both opponents are affected.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (23, 'While this Pokémon is in battle, opposing Pokémon cannot flee or switch out.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (24, 'Whenever a move makes contact with this Pokémon, the move''s user takes 1/8 of its maximum HP in damage.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (25, 'This Pokémon is immune to damaging moves that are not super effective against it.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (26, 'This Pokémon is immune to ground-type moves, spikes, toxic spikes, and arena trap.
INSERT INTO pokemon.verboseeffect (id, effect, short_effect, language_id) VALUES (27, 'Whenever a move makes contact with this Pokémon, the move''s user has a 30% chance of being paralyzed, poisoned, or put to sleep, chosen at random.
